if mibBuilder.loadTexts: mscTrkMeasuredSpeedToIf.setStatus('mandatory')
if mibBuilder.loadTexts: mscTrkMeasuredSpeedToIf.setDescription("This attribute indicates the current 'transmittable' bandwidth of the underlying facility. For a Trunk with a Unack subcomponent, and a DpnGateway with a Utp subcomponent, if a serial port is used, the value is the measured transmit speed of the port; if a channelized port (E1/DS1) is used, the value is the measured transmit speed of the Channel. For a Trunk with an AtmAccess subcomponent, the value is calculated by converting the VCC transmit cell rate to an equivalent bit rate. The VCC transmit cell rate is determined based on the vccReportingBw attribute of the Trunk AtmAccess component. If vccReportingBw has a value of pcr and attribute bwElastic of AtmAccess has a value of no, the peak cell rate (PCR) of the VCC, defined in txTrafficDescParm of AtmIf Vcc Vcd, is used. If vccReportingBw has a value of pcr and attribute bwElastic of AtmAccess has a value of yes, the minimum of the PCR, defined in txTrafficDescParm of AtmIf Vcc Vcd, and the current cell rate (CCR) of the VCC is used. If vccReportingBw has a value of acr, the best measurement of the actual cell rate (ACR) of the VCC is used, which is the minimum of the PCR, the CCR and the actual shaping rate (ASR). For a DpnGateway with a FrAccess subcomponent, the value indicates the committedInformationRate of FrAccess FrMuxSetup. A value of zero is displayed when the underlying facility is disabled or the current 'transmittable' bandwidth is unknown.")
